import React from "react";
import "../assets/css/Contact.scss"
function showLanguageModal(){
    console.log(this);
}
function Contact(){
    return(
        <div id="contact-container">
            <h1>Contact</h1>
            <form action="" target="EmptyWindow" method="POST">
                    <input name="Title" type="text" placeholder='Sujet' required/>
                    <textarea name="Content"  placeholder='Message' type={"textarea"}required/>
                    <input name="Email"  placeholder='Email' type={"text"}/>
                    <input name="Telephone"  placeholder='Telephone ( non nécessaire si email fourni )' type={"text"}/>
                    
                <label htmlFor="languageButton">Languages associés au message: </label>
                <i name="languageButton"className="far fa-plus-square" onClick={showLanguageModal}></i>
                <div id="LanguageTarget"></div>
                <input type={"submit"}/>
            </form>
               
        </div>
    )
}

export default Contact;
